import React from 'react';

const Resources = () => (
    <div>
        <h1>Resources</h1>
        <ul>
            <li>Books</li>
            <li>CD</li>
            <li>Annointing Oils</li>
            <li>Scripture Cards</li>
        </ul>
    </div>
)

export default Resources;
